def _has_leap_day(start: Date, end: Date) -> bool:
    """
    Indicates if the range has any leap day.
    """
    # Check if any date in the range (start inclusive, end exclusive) is Feb 29
    # February 29 only occurs in leap years
    for single_date in _get_date_range(start, end):
        if single_date.month == 2 and single_date.day == 29:
            return True
    return False
